import React from 'react';
import Logo from '../assets/logo.png';

const Header = () => {
  const headerStyle = {
    backgroundColor: '#DAF5B6',
    padding: '10px 0',
  };

  const logoImageStyle = {
    height: '40px',
    marginRight: '10px',
  };

  const navLinkStyle = {
    color: '#388e3c',
    fontWeight: '500',
    textDecoration: 'none',
  };

  const loginButtonStyle = {
    backgroundColor: '#388e3c',
    color: '#fff',
    borderRadius: '5px',
    padding: '8px 15px',
    marginLeft: '15px',
    border: 'none',
  };

  return (
    <header style={headerStyle}>
      <div className="container d-flex justify-content-between align-items-center">
        {/* Logo */}
        <div className="d-flex align-items-center">
          <img src={Logo} alt="EcoGuard Logo" style={logoImageStyle} />
          <span className="fw-bold text-success" style={{ fontSize: '20px' }}>
            EcoGuard
          </span>
        </div>

        {/* Navigation */}
        <nav>
          <ul className="nav d-flex align-items-center">
            <li className="nav-item">
              <a className="nav-link px-2" href="/" style={navLinkStyle}>
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link px-2" href="/report" style={navLinkStyle}>
                Report
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link px-2" href="/statistics" style={navLinkStyle}>
                Statistics
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link px-2" href="/article" style={navLinkStyle}>
                Article
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link px-2" href="/contact" style={navLinkStyle}>
                Contact
              </a>
            </li>
          </ul>
        </nav>

        {/* Login Button */}
        <button style={loginButtonStyle}>Login</button>
      </div>
    </header>
  );
};

export default Header;
